This contrived example is taken from radium/examples/schroedinger.rs. It shows how the Radium trait can be used by a worker function to manipulate data, and how the different types can be used to work in sequence or in parallel. Note: Radium’s MSRV is 1.60, while the scoped-threads API used here stabilized in 1.63. use radium::{Radium, types::{RadiumU64, Atom, Isotope, Radon}};
use std::{ cell::Cell, sync::atomic::{AtomicU64, Ordering}, thread, time::Duration,
}; fn do_work<R: Radium<Item = u64>>(this: &R, ident: u8) { let on_entry = this.load(Ordering::SeqCst); println!("{: >2} step 0 sees: {: >2}", ident, on_entry); let before_add = this.fetch_add(10, Ordering::SeqCst); println!("{: >2} step 1 sees: {: >2}", ident, before_add); let after_add = this.load(Ordering::SeqCst); println!("{: >2} step 2 sees: {: >2}", ident, after_add); thread::sleep(Duration::from_millis(after_add)); let before_sub = this.fetch_sub(3, Ordering::SeqCst); println!("{: >2} step 3 sees: {: >2}", ident, before_sub); let on_exit = this.load(Ordering::SeqCst); println!("{: >2} step 4 sees: {: >2}", ident, on_exit);
} static ATOM: AtomicU64 = AtomicU64::new(0);
static RADIUM: RadiumU64 = RadiumU64::new(0); fn main() { let cell = Cell::new(0u64); let atom = Atom::new(0u64); let isotope = Isotope::new(0u64); let radon = Radon::new(0u64); println!("atoms"); thread::scope(|s| for ident in 0 .. 3 { s.spawn(move || do_work(&ATOM, ident)); }); println!(); thread::scope(|s| for ident in 3 .. 6 { let atom = &atom; s.spawn(move || do_work(atom, ident)); }); println!(); println!("isotopes"); thread::scope(|s| for ident in 6 .. 9 { s.spawn(move || do_work(&RADIUM, ident)); }); println!(); for ident in 9 .. 12 { do_work(&isotope, ident); } println!(); println!("cells"); for ident in 12 .. 15 { do_work(&cell, ident); } println!(); for ident in 15 .. 18 { do_work(&radon, ident); } println!();
}
